class Solution {
  int minimumBeautifulSubstrings(String s) {
    List<int> dp = List.filled(s.length + 1, 0);
    dp[0] = 0;
    for (int i = 1; i <= s.length; i++) {
      dp[i] = -1;
      int val = 0;
      for (int j = i; j >= 1; j--) {
        val += (s[j - 1] == '1' ? 1 << (i - j) : 0);
        if (s[j - 1] == '1' && isPowerOfFive(val)) {
          if (dp[j - 1] != -1) {
            dp[i] = dp[i] == -1 ? dp[j - 1] + 1 : min(dp[i], dp[j - 1] + 1);
          }
        }
      }
    }
    return dp[s.length];
  }

  bool isPowerOfFive(int n) {
    while (n > 1 && n % 5 == 0) {
      n ~/= 5;
    }
    return n == 1;
  }

  int min(int a, int b) => a < b ? a : b;
}
